import{_ as e,o as p,c as a,a as r}from"./app.ec7a89e7.js";const f=JSON.parse('{"title":"\u5E74\u7EC8\u603B\u7ED3","description":"","frontmatter":{"title":"\u5E74\u7EC8\u603B\u7ED3","date":"2021-12-06T22:07:12.000Z"},"headers":[{"level":2,"title":"\u5E8F","slug":"\u5E8F","link":"#\u5E8F","children":[]},{"level":2,"title":"\u56DE\u9996","slug":"\u56DE\u9996","link":"#\u56DE\u9996","children":[{"level":3,"title":"\u5DE5\u4F5C","slug":"\u5DE5\u4F5C","link":"#\u5DE5\u4F5C","children":[]},{"level":3,"title":"\u751F\u6D3B","slug":"\u751F\u6D3B","link":"#\u751F\u6D3B","children":[]}]},{"level":2,"title":"\u5176\u4ED6","slug":"\u5176\u4ED6","link":"#\u5176\u4ED6","children":[]}],"relativePath":"posts/summary_2011.md"}'),t={name:"posts/summary_2011.md"},l=r('<nav class="table-of-contents"><ul><li><a href="#\u5E8F">\u5E8F</a></li><li><a href="#\u56DE\u9996">\u56DE\u9996</a><ul><li><a href="#\u5DE5\u4F5C">\u5DE5\u4F5C</a></li><li><a href="#\u751F\u6D3B">\u751F\u6D3B</a></li></ul></li><li><a href="#\u5176\u4ED6">\u5176\u4ED6</a></li></ul></nav><h2 id="\u5E8F" tabindex="-1">\u5E8F <a class="header-anchor" href="#\u5E8F" aria-hidden="true">#</a></h2><p>2021\u5E74\uFF0C\u53D1\u751F\u7684\u4E8B\u60C5\u633A\u591A\u7684\uFF0C\u4E0D\u7BA1\u5DE5\u4F5C\u4E0A\u8FD8\u662F\u751F\u6D3B\u4E0A\uFF0C\u90FD\u523B\u6EE1\u4E86\u65F6\u95F4\u7684\u5212\u75D5\u3002\u5982\u679C\u7528\u4E00\u53E5\u8BDD\u6765\u63CF\u8FF0\u7684\u8BDD\uFF0C<strong>\u6211\u7684\u9752\u6625\uFF0C\u7ED3\u675F\u4E86\u3002</strong></p><h2 id="\u56DE\u9996" tabindex="-1">\u56DE\u9996 <a class="header-anchor" href="#\u56DE\u9996" aria-hidden="true">#</a></h2><h3 id="\u5DE5\u4F5C" tabindex="-1">\u5DE5\u4F5C <a class="header-anchor" href="#\u5DE5\u4F5C" aria-hidden="true">#</a></h3><p>\u4ECA\u5E74\uFF0C\u60F3\u53BB\u5927\u5382\u3002</p><p>17\u5E74\u6BD5\u4E1A\u5230\u4ECA\u5E74 \uFF0C\u5728\u4E24\u5BB6\u5C0F\u516C\u53F8\u91CC\u5EA6\u8FC7\u4E864\u4E2A\u5E74\u5934\u3002\u7B2C\u4E00\u5BB6\u627E\u5230\u4E86\u4E00\u8D77\u5B66\u4E60\u7684\u540C\u4E8B\uFF0C\u6574\u4F53\u8FD8\u7B97\u6709\u6240\u6536\u83B7\uFF0C\u7B2C\u4E8C\u5BB6\u62C5\u4EFB\u7C7B\u4F3CTL\u7684\u5C97\u4F4D\uFF0C\u4F46\u662F\u53EA\u662F\u4EBA\u5C11\u800C\u5DF2\uFF0C\u5DE5\u4F5C\u4E0A\u8003\u8651\u7684\u66F4\u5168\u9762\u70B9\u4E86\uFF0C\u4E5F\u7B97\u4E3A\u4EE5\u540E\u6253\u57FA\u7840\u4E86\u3002</p><p>\u5230\u4ECA\u5E741\u6708\u4EFD\uFF0C\u8111\u5B50\u91CC\u6709\u79CD\u5929\u82B1\u677F\u7684\u611F\u89C9\uFF0C\u505A\u4E1A\u52A1\u6CA1\u4EC0\u4E48\u95EE\u9898\uFF0C\u4F46\u662F\u518D\u6DF1\u5C42\u6B21\u7684\u5B66\u4E60\u548C\u4F7F\u7528\u4E00\u4E9B\u77E5\u8BC6\uFF0C\u5C31\u4E0D\u77E5\u9053\u5F80\u54EA\u513F\u4F7F\u52B2\u513F\u4E86\u3002\u5728\u627E\u4E86\u4E09\u4E24\u4E2A\u597D\u53CB\u540E\uFF0C\u8FD8\u662F\u51B3\u5B9A\u81EA\u5DF1\u4E70\u70B9vue\u7684\u8BFE\u7A0B\u5B66\u4E60\uFF0C\u672C\u6765\u5C31\u662F\u60F3\u5355\u7EAF\u7684\u5B66\u4E00\u4E0B\uFF0C\u8D8A\u5B66\u8D8A\u89C9\u5F97\u6709\u66F4\u5927\u7684\u4E16\u754C\u5728\u5411\u4F60\u62DB\u624B\uFF0C\u4E8E\u662F\uFF0C\u5728\u770B\u5B8C\u89C6\u9891\u4E4B\u540E\u505A\u4E86\u4E2A\u51B3\u5B9A\uFF1A\u4ECA\u5E74\u60F3\u529E\u6CD5\u53BB\u5927\u5382\u770B\u770B\uFF0C\u7136\u540E\u5C31\u5F00\u59CB\u51C6\u5907\u6709\u5173\u7684\u8D44\u6599\u3002</p><p>\u60F3\u4E86\u89E3\u5708\u5916\u7684\u4E16\u754C\uFF0C\u6CA1\u6709\u4E2A\u5F15\u8DEF\u4EBA\u786E\u5B9E\u4F1A\u649E\u5230\u5899\uFF0C\u8BBA\u575B\u4E0A\u627E\u7B49\u7EA7\u9AD8\u7684\u5927\u4F6C\uFF0C\u52A0\u597D\u53CB\uFF0C\u8FDB\u7FA4\uFF0C\u770B\u4ED6\u4EEC\u4E00\u5929\u5929\u5206\u4EAB\u6587\u7AE0\uFF0C\u96F7\u6253\u4E0D\u52A8\uFF0C\u5FC3\u91CC\u5F00\u59CB\u4E86\u81EA\u8D23\u6A21\u5F0F\u3002</p><p><strong>\u60F3\u529E\u6CD5\u8F93\u51FA\u81EA\u5DF1\u5B66\u5230\u7684\u77E5\u8BC6\uFF0C\u662F\u4E00\u4E2A\u8861\u91CF\u81EA\u5DF1\u6709\u6CA1\u6709\u5B66\u4F1A\u7684\u65B9\u6CD5\u3002</strong></p><p>\u8BFB\u4E66\uFF0C\u5199\u535A\u5BA2 \uFF0C\u53D1\u8BBA\u575B\uFF0C\u505A\u516C\u4F17\u53F7\uFF0C\u53C2\u4E0E\u5F00\u6E90\u9879\u76EE......\u4E00\u4EF6\u4EF6\u4E8B\u4E5F\u5C31\u6162\u6162\u5F00\u59CB\u53BB\u505A\u4E86\uFF0C\u628A\u80FD\u60F3\u5230\u7684\u5E76\u4E14\u5728\u80FD\u529B\u8303\u56F4\u4E4B\u5185\u7684\u4E8B\u505A\u597D\uFF0C\u5C31\u662F\u6700\u5927\u7684\u8FDB\u6B65\u3002</p><p>\u575A\u6301\u4E86\u534A\u5E74\u4E4B\u540E\uFF0C\u8FD8\u7B97\u529F\u592B\u4E0D\u8D1F\u6709\u5FC3\u4EBA\u5427\uFF0C\u8FDB\u4E86\u6854\u5382\u3002\u5728\u6B64\u4E4B\u524D\uFF0C\u62FF\u5230\u4E865\u4E2Aoffer\uFF0C\u4F46\uFF0C\u8FFD\u5230\u68A6\u4E86\uFF0C\u90A3\u5C31\u597D\u597D\u7684\u5728\u68A6\u91CC\u6447\u66F3\u5427\u3002</p><p>\u8FDB\u6765\u4E4B\u540E\uFF0C\u6700\u5927\u7684\u611F\u89E6\u5C31\u662F\uFF1A\u4E16\u754C\u5F88\u5927\uFF0C\u6210\u4E3A\u4F60\u60F3\u6210\u4E3A\u7684\u5427\u3002</p><h3 id="\u751F\u6D3B" tabindex="-1">\u751F\u6D3B <a class="header-anchor" href="#\u751F\u6D3B" aria-hidden="true">#</a></h3><p>\u5173\u4E8E\u751F\u6D3B\u7684\u8BDD\uFF0C\u8FD1\u671F\u8111\u5B50\u633A\u4E71\u7684\uFF0C\u5C31\u4E0D\u60F3\u4E86\uFF0C\u628A\u4ECA\u5E743\u6708\u4EFD\u5199\u7684\u4E00\u7BC7\u611F\u60F3\u653E\u4E0A\u6765\u5427\u3002</p><p><strong>--- \u5F00\u5934 ---</strong></p><p>\u4ECA\u5E74 26 \u5C81\u4E86\u3002</p><p>22 \u5C81\u5230 26 \u5C81\u662F\u6211\u7684\u5E74\u8F7B\u6C14\u76DB\u300222 \u5C81\u5927\u5B66\u6BD5\u4E1A\u5F00\u59CB\u5DE5\u4F5C\uFF0C24 \u5C81\u662F 2019 \u5E74\u5DE5\u4F5C\u5DF2 2 \u5E74\uFF0C\u6765\u5230\u91CD\u5E86\u76F4\u5230 2021 \u5E74\uFF0C\u53C8\u5EA6\u8FC7\u4E86 2 \u5E74\u3002</p><p>2 \u5E74\u5DE5\u4F5C\uFF0C2 \u5E74\u604B\u7231\u3002</p><p>\u611F\u89C9\u5E74\u8F7B\u5DF2\u4E0D\u5C5E\u4E8E\u6211\u4E86\uFF0C\u5E74\u8F7B\u5DF2\u7ECF\u662F\u4E00\u4E2A\u501F\u53E3\u4E86\uFF0C\u5EA6\u8FC7\u7684\u65F6\u95F4\u6B63\u597D\u662F\u9EC4\u91D1\u5E74\u9F84\uFF0C\u867D\u7136\u7EF4\u57FA\u4E0A\u8BF4 30 \u5C81\u4E4B\u524D\u7684\u7537\u6027\u53EA\u662F\u7537\u751F\uFF0C\u771F\u6B63\u7684\u7537\u4EBA\u662F\u5728 30 \u5C81\u5230 40 \u5C81\u3002</p><p>24 \u5C81\u5DE5\u4F5C\u7684\u4E24\u5E74\uFF0C\u662F\u5B66\u4E60\u6700\u5FEB\u7684\u65F6\u5149\uFF0C\u4E4B\u524D\u6211\u5F88\u5E86\u5E78\u81EA\u5DF1\u6CA1\u90A3\u4E48\u6325\u970D\uFF0C\u4E24\u5E74\u4E5F\u5B66\u5230\u4E86\u4E1C\u897F\uFF0C\u8D77\u7801\u997F\u4E0D\u7740\u81EA\u5DF1\uFF0C\u7136\u800C 26 \u5C81\u7684\u6211\u89C9\u5F97\u90A3\u4E24\u5E74\u8FD8\u4E0D\u591F\u52AA\u529B\u3002</p><p>\u4E4B\u540E\u7684\u8C08\u604B\u7231\u7684\u4E24\u5E74\uFF0C\u4E5F\u662F\u6700\u5FEB\u4E50\u7684\u65F6\u5149\uFF0C\u867D\u7136\u4E2D\u95F4\u6709\u5F88\u591A\u5C0F\u63D2\u66F2\uFF0C\u800C 26 \u5C81\u7684\u6211\u89C9\u5F97\u8FD9\u4E24\u5E74\u7684\u6210\u957F\u662F\u4E24\u4E2A\u4EBA\u7684\u78E8\u5408\u548C\u88C2\u7F1D\u8DB3\u591F\u591A\u3002</p><p>\u73B0\u5728\u7684\u6211\u5DF2\u7ECF\u73A9\u4E0D\u8D77\u4E86\uFF0C\u5C31\u50CF\u522B\u4EBA\u8BF4\u7684\uFF0C\u4EBA\u6D3B\u5230\u4E86\u4E00\u5B9A\u7A0B\u5EA6\uFF0C\u5404\u79CD\u5404\u6837\u7684\u538B\u529B\u5C31\u4F1A\u968F\u4E4B\u800C\u6765\uFF0C\u8D8A\u6765\u8D8A\u591A\u7684\u4E0D\u786E\u5B9A\u56E0\u7D20\u4F1A\u65F6\u523B\u5F71\u54CD\u7740\u4F60\u30022020 \u5E74\u5BF9\u4E8E\u4E16\u754C\u662F\u5927\u707E\u5927\u96BE\u7684\u4E00\u5E74\uFF0C2021 \u5E74\u6211\u60F3\u8BA8\u4E2A\u597D\u5F69\u5934\uFF0C\u5E0C\u671B\u5728 30 \u5C81\u5230\u8FBE\u4E4B\u524D\u7684 4 \u5E74\u91CC\uFF0C\u9762\u5BF9\u5404\u79CD\u4E0D\u786E\u5B9A\u6027\u56E0\u7D20\u53EF\u4EE5\u6709\u7A33\u64CD\u80DC\u5238\u7684\u628A\u63E1\u548C\u80FD\u529B\u53BB\u62B5\u6321\u3002\u6240\u4EE5\u5728 1 \u6708\u4EFD\u5F00\u59CB\uFF0C\u6211\u5F00\u59CB\u903C\u81EA\u5DF1\u505A\u4E00\u4E9B\u4EE5\u524D\u4F1A\u611F\u5230\u53EF\u7B11\u548C\u4E0D\u7406\u89E3\u7684\u4E8B\u60C5\u3002</p><p>\u6211\u8FD8\u662F\u5E0C\u671B\u6211\u662F\u4E00\u4E2A\u6709\u80FD\u529B\u7684\u4EBA\uFF0C\u6709\u80FD\u529B\u517B\u6D3B\u81EA\u5DF1\uFF0C\u6709\u80FD\u529B\u4FDD\u62A4\u7231\u7684\u4EBA\u3002</p><p>\u83AB\u7B49\u95F2\uFF0C\u767D\u4E86\u5C11\u5E74\u5934\uFF0C\u7A7A\u60B2\u5207\u2026\u2026</p><p>\u6CA1\u6709\u4EBA\u80FD\u9884\u6D4B\u672A\u6765\uFF0C\u4F46\u603B\u6709\u4EBA\u540E\u6094\u5F53\u521D\u2026\u2026</p><p>\u73B0\u5728\u7684\u6211\u540E\u6094\u5F53\u521D\u505A\u9E21\u5934\u7684\u9009\u62E9\uFF0C\u867D\u7136\u5E74\u8F7B\u6C14\u76DB\u5C5E\u4E8E\u6B63\u5E38\u7684\u73B0\u8C61\uFF0C\u4F46\u603B\u4F1A\u6709\u4E00\u5929\u4E3A\u81EA\u5DF1\u4E70\u5355\u3002</p><p>\u6D3B\u7740\u53EA\u662F\u4E3A\u4E86\u4E8C\u4E09\u788E\u94F6\uFF0C\u4F5C\u4E3A\u7537\u751F\uFF0C\u6CA1\u6709\u4EC0\u4E48\u6BD4\u788E\u94F6\u66F4\u6709\u5B89\u5168\u611F\u3002</p><p>\u6162\u6162\u4F53\u4F1A\u5230\u4E86\u957F\u8F88\u5929\u5929\u52B3\u4F5C\u7684\u539F\u56E0\uFF0C\u4E0D\u662F\u56E0\u4E3A\u4ED6\u4EEC\u7684\u5B66\u8BC6\u548C\u89C1\u8BC6\uFF0C\u4ED6\u4EEC\u4E5F\u60F3\u4F11\u606F\uFF0C\u4F46\u662F\u4ED6\u4EEC\u4E0D\u6562\u95F2\u4E0B\u6765\uFF0C\u751F\u6D3B\u4E5F\u4E0D\u8BA9\u2026\u2026</p><p>\u6211\u611F\u89C9\u6211\u5DF2\u7ECF\u6709\u4E86\u4E2D\u5E74\u5371\u673A\uFF0C\u623F\u5B50\u8F66\u5B50\u7968\u5B50\uFF0C\u6BCF\u4E00\u6837\u90FD\u5F88\u6C89\u91CD\u3002</p><p>\u8FD9\u4E00\u751F\u6CA1\u6709\u4EC0\u4E48\u6BD4\u65E9\u70B9\u52AA\u529B\u66F4\u91CD\u8981\u4E86\uFF0C\u5632\u7B11\u548C\u8511\u89C6\u53EA\u662F\u56E0\u4E3A\u7231\u4F60\u7684\u4EBA\u4E0D\u4F11\u606F\u5730\u66FF\u4F60\u5206\u62C5\u4E86\u800C\u5DF2\uFF0C\u800C\u81EA\u5DF1\u65E9\u665A\u8981\u507F\u8FD8\u8FD9\u4E00\u5207\u3002</p><p>\u6211\u4E0D\u6562\u5962\u6C42\u6211\u4F1A\u6709\u4E00\u756A\u4F5C\u4E3A\uFF0C\u8BA9\u6211\u7231\u7684\u4EBA\u548C\u7231\u6211\u7684\u4EBA\u80FD\u6D3B\u5F97\u6F47\u6D12\u81EA\u7531\u3002</p><p>\u6211\u53EA\u5E0C\u671B\u6211\u7684 26 \u5C81\u662F\u6211\u4E00\u751F\u7684\u7FFB\u7BC7\uFF0C\u4E0D\u7BA1\u597D\u574F\uFF0C\u90FD\u5E94\u8BE5\u597D\u597D\u7684\u505A\u70B9\u4E8B\u60C5\uFF0C\u5C11\u70B9\u4E0D\u9760\u8C31\uFF0C\u5C11\u70B9\u8F7B\u72C2\uFF0C\u591A\u70B9\u601D\u8003\uFF0C\u591A\u70B9\u8E0F\u5B9E\uFF0C\u7ED9\u5979\u4E00\u4EFD\u5B89\u5168\u611F\uFF0C\u4E5F\u7ED9\u6211\u81EA\u5DF1\u4E00\u4EFD\u5B89\u5168\u611F\u3002</p><p>\u8D77\u7801\u5728\u4ECA\u540E\uFF0C\u4E0D\u8981\u505A\u770B\u8D77\u6765\u4EE5\u540E\u4F1A\u540E\u6094\u7684\u4E8B\u3002</p><p>\u5728\u6700\u5E74\u8F7B\u7684\u5E74\u7EAA\uFF0C\u53EF\u4EE5\u5E74\u5C11\u65E0\u4E3A\uFF0C\u4F46\u662F\u4E0D\u53EF\u4EE5\u8F9C\u8D1F\u7231\u4F60\u7684\u4EBA\u5BF9\u4F60\u7684\u4FE1\u4EFB\u548C\u671F\u76FC\uFF0C\u5176\u5B9E Ta \u4EEC\u672C\u53EF\u4EE5\u4E0D\u8FD9\u4E48\u505A\u3002</p><p>26 \u5C81\uFF0C\u597D\u81EA\u4E3A\u4E4B\u5427</p><p><strong>--- \u7ED3\u5C3E ---</strong></p><h2 id="\u5176\u4ED6" tabindex="-1">\u5176\u4ED6 <a class="header-anchor" href="#\u5176\u4ED6" aria-hidden="true">#</a></h2><p>\u4E0A\u4E2A\u5468\u672B\uFF0C\u51CC\u66683\u70B9\uFF0C300\u6761\u804A\u5929\u8BB0\u5F55\uFF0C\u5341\u51E0\u5F20\u622A\u56FE\uFF0C\u628A\u4E00\u4E2A\u5165\u95E8\u524D\u7AEF\u7684\u5C0F\u767D\u6559\u4F1A\u4E86\u539F\u578B\u94FE\u7684\u7ED3\u6784\u548C\u4F7F\u7528\u3002</p><p>\u60F3\u4E0D\u60F3\u6559\u5462\uFF1F\u4E00\u822C\uFF0C\u4F46\u662F\u60F3\u5230\u6211\u66FE\u7ECF\u8D70\u8FC7\u7684\u8DEF\uFF0C\u8FD8\u662F\u53EF\u4EE5\u7ED9\u4ED6\u6307\u4E2A\u65B9\u5411\u7684\u3002</p><p>\u5176\u5B9E\u6211\u633A\u60F3\u505A\u4E00\u4E9B\u6709\u610F\u4E49\u7684\u4E8B\u7684\uFF0C\u53EA\u6015\u52A8\u4E86\u8C01\u7684\u86CB\u7CD5\u3002</p><p>\u5F53\u4E0B\u7A0B\u5E8F\u5458\u7684\u95E8\u69DB\u8D8A\u6765\u8D8A\u4F4E\uFF0C \u5438\u5F15\u4EBA\u8FC7\u6765\u5B66\u7684\u5927\u591A\u4E5F\u90FD\u662F\u5DE5\u8D44\uFF0C\u8FD9\u4E2A\u6211\u53EF\u4EE5\u7406\u89E3\uFF0C\u6323\u53E3\u996D\u5403\u561B\uFF0C\u4E0D\u8FC7\u4E0D\u53EF\u5426\u8BA4\u7684\u662F\uFF0C\u5B58\u5728\u4E00\u79CD\u98CE\u6C14\uFF0C\u85AA\u8D44\u548C\u80FD\u529B\u4E0D\u6210\u6B63\u6BD4\uFF0C\u7136\u540E\u5439\u5618\u3001\u5212\u6C34\u3001\u65E0\u9650\u5236\u6478\u9C7C\uFF0C\u8BB2\u9053\u7406\u5934\u5934\u662F\u9053\uFF0C\u7B49\u8DF3\u69FD\u7684\u90A3\u4E00\u5929\uFF0C\u7A81\u7136\u5C31\u614C\u4E86\uFF0C\u6CA1\u6709\u51C6\u5907\uFF0C\u6CA1\u6709\u8FD9\u6CA1\u6709\u90A3\uFF0C\u627E\u4E0D\u5230\u5DE5\u4F5C\u5C31\u4F1A\u8BF4\u73AF\u5883\u4E0D\u597D\uFF0C\u5C97\u4F4D\u9971\u548C\u4E86\u4E4B\u7C7B\u7684\u8BDD\uFF0C\u671F\u671B\u7740\u627E\u4E00\u4E2A\u66F4\u50BB\u7684\u8001\u677F\u53D1offer\uFF0C\u7136\u540E\u65E5\u590D\u4E00\u65E5\u3002</p><p>\u4E5F\u4E0D\u80FD\u8BF4\u4E0D\u597D\uFF0C\u56E0\u4E3A\u8FD9\u4E2A\u793E\u4F1A\u80FD\u5403\u9971\u809A\u5B50\u5C31\u4E0D\u9519\u4E86\uFF0C\u53EA\u662F\u6211\u89C9\u5F97\uFF0C\u6574\u4F53\u6765\u770B\u7684\u8BDD\uFF0C\u548C\u517B\u8001\u6CA1\u4EC0\u4E48\u533A\u522B\u3002</p><p>\u6211\u5728\u8FD9\u79CD\u601D\u60F3\u7684\u5F15\u5BFC\u4E0B\uFF0C\u89C9\u5F97\u53EF\u4EE5\u505A\u4E00\u4E9B\u4E8B\uFF0C\u6BD4\u5982\u62C9\u51E0\u4E2A\u4EBA\u7EC4\u4E2A\u81EA\u5B66\u7684\u7FA4\u554A\uFF0C\u6253\u5361\u554A\u7B49\u7B49\uFF0C\u8FD9\u4E9B\u5C0F\u4E8B\u6362\u505A\u4E4B\u524D\u7684\u6211\uFF0C\u80AF\u5B9A\u4E0D\u4F1A\u505A\uFF0C\u56E0\u4E3A\u5DF2\u7ECF\u770B\u5230\u7ED3\u679C\u4E86\u3002\u4E0D\u8FC7\u81EA\u5DF1\u770B\u5230\u4E86\u4E00\u4E9B\u4E0D\u4E00\u6837\u7684\u4E1C\u897F\u4E4B\u540E\uFF0C\u89C9\u5F97\u53EF\u4EE5\u8BD5\u7740\u505A\u4E00\u4E0B\uFF0C\u5BF9\u4E00\u4E2A\u4EBA\u6709\u5E2E\u52A9\uFF0C\u90A3\u8FD9\u4EF6\u4E8B\u8D77\u7801\u5C31\u662F\u6709\u610F\u4E49\u7684\u3002</p><p><strong>\u5927\u4EBA\u4EEC\u603B\u8BF4\uFF0C\u4E0D\u80FD\u8F93\u5728\u8D77\u8DD1\u7EBF\u4E0A\uFF0C\u5176\u5B9E\uFF0C\u8981\u8D85\u8D8A\u7684\uFF0C\u6C38\u8FDC\u4E0D\u662F\u522B\u4EBA\uFF0C\u800C\u662F\u6628\u5929\u7684\u81EA\u5DF1\u3002</strong></p>',45),i=[l];function n(s,h,d,o,c,_){return p(),a("div",null,i)}const g=e(t,[["render",n]]);export{f as __pageData,g as default};
